import { useState } from "react"
const Tasks = () => {
    const [tasks, setTasks] = useState([
        {
            id:1,
            text:'Doctors Appointment',
            day:'Feb 5th at 2:30PM',
            reminder:true,
        },
        {
            id:2,
            text:'Meeting',
            day:'Feb 5th at 5:30PM',
            reminder:true,
        },
        {
            id:3,
            text:'Gym',
            day:'Feb 5th at 7:30PM',
            reminder:true,
        }
    ])
    return (
        <>
            {tasks.map((task)=>(
            <h3 key ={task.id}>{task.text}</h3>))}
        </>
    )
}

export default Tasks
